import React from "react";
import { makeStyles, useTheme } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import CardActions from "@material-ui/core/CardActions";
import CardMedia from "@material-ui/core/CardMedia";
import Typography from "@material-ui/core/Typography";
import Chip from "@material-ui/core/Chip";
import docImg from "../../img/results/docAlex.png";
import FavoriteIcon from "@material-ui/icons/Favorite";
import IconButton from "@material-ui/core/IconButton";
import Grid from "@material-ui/core/Grid";
import Box from "@material-ui/core/Box";
const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    marginLeft: 30,
    marginRight: 30,
  },
  details: {
    display: "flex",
    flexDirection: "row",
  },
  content: {
    flex: "1 0 auto",
  },
  cover: {
    width: "60%",
    marginTop: 20,
    marginBottom: 20,
    backgroundSize: "contain",
  },
}));

export default function MediaControlCard() {
  const classes = useStyles();
  const theme = useTheme();

  return (
    <Card className={classes.root}>
      <div className={classes.details}>
        <Grid container spacing={0}>
          <Grid item md={3}>
            <Box display="flex" justifyContent="center">
              <CardMedia
                component="img"
                className={classes.cover}
                image={docImg}
              ></CardMedia>
            </Box>
          </Grid>
          <Grid item md={7}>
            <CardContent>
              <Typography variant="h6" color="primary">
                Dr. Alex Leow
              </Typography>
              <br></br>
              <Typography variant="subtitle1" color="textSecondary">
                Specialty: <span>Gastroenterology</span>
              </Typography>
              <Typography variant="subtitle1" color="textSecondary">
                Hospital: <span>Pantai Hospital Kuala Lumpur</span>
              </Typography>
              <Typography variant="subtitle1" color="textSecondary">
                Languages: <span>English, Malay, Mandarin, Cantonese</span>
              </Typography>
              <br></br>
              <Chip color="secondary" size="small" label="Private"></Chip>
            </CardContent>
          </Grid>
          <Grid item md={2}>
            <Box
              mt={3}
              mr={1}
              display="flex"
              flexDirection="column"
              justifyContent="center"
              alignItems="center"
            >
              <FavoriteIcon color="secondary" />
              <Typography variant="body2" color="primary">
                100
              </Typography>
            </Box>
          </Grid>
        </Grid>
      </div>
    </Card>
  );
}
